__sel4_ipc_buffer_obj = (__ehdr_start & ~(4096 - 1)) - 4096
SECTIONS {
    .persistent : {
        *(.persistent .persistent.*)
    }
} INSERT BEFORE .data;

ASSERT(DEFINED(_reset), "_reset is not defined")

ENTRY(_reset)
SECTIONS {
    .tdata : {}
    .tbss : {}
    .tls ALIGN(MAX(16, MAX(ALIGNOF(.tdata), ALIGNOF(.tbss)))) (NOLOAD) : {
        __tls_start = .;
        . += 16;
        . = ALIGN(MAX(ALIGNOF(.tdata), ALIGNOF(.tbss)));
        . += SIZEOF(.tdata);
        . = ALIGN(ALIGNOF(.tbss));
        . += SIZEOF(.tbss);
        __tls_end = .;
    }
} INSERT AFTER .bss;
